import React from 'react';
import { useSelector } from 'react-redux';

interface RootState {
    message: string;
}

const Hello: React.FC = () => {
    const message = useSelector((state: RootState) => state.message);

    return (
        <div>
            <h1>{message}</h1>
        </div>
    );
};

export default Hello;
